@AndyGrammer is one of my dearest friends in the world. It meant so much to me that he was willing to come on this podcast and have such a raw and uncomfortable conversation. Not only to stay in the room but model what it looks like to be a man. AND a man that wants to be shaken. Andy’s mom, who passed away, was one of the most beautiful and powerful women. I can only imagine how proud she would be of her son for having the conversation he had with @feministabulous, @jamey_heath_ and I. 

I love you so much brother 🙏 ❤️ 

Please don’t miss this incredible real, raw episode of The Man Enough Podcast. #ManEnough
